font-family: Open Sans;
font-style: normal;
font-weight: 600;
font-size: 20px;
line-height: 27px;
margin-top:60px;
color: #000000;
`;

const Search = ({articles, searchingComponent}) => {
    return (
        <>
            <Container>
                <SearchField />
                <Title>Popular Posts</Title>
                {articles.map((article) => (

                    <Card key={article.date} article={article} />

                ))}

            </Container>
        </>
    );
}

export default Search;
